import React from "react";
import "./assets/css/App.css";
import DashBoard from "./components/Dashboard";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      tweets: [],
      isLoaded: false,
    };
  }

  componentDidMount() {}

  render() {
    return (
      <div>
        <DashBoard tweets={this.state.tweets}></DashBoard>
      </div>
    );
  }
}

export default App;
